INSERT INTO `ask_an_expert_question` VALUES (19,'Old version of Windows and MS Office','word','Sir I am having Windows 7 on my laptop and it has the 2007 version of Microsoft office in it. In the assignment section of Day 1, we have an assignment to create a birthday card or an event invitation in MS Word using the available templates in it. Unfortunately I can\'t find any templates related to birthdays or  invitation in my version of MS word. What should I do sir?','2021-07-26 17:09:46.623994','2021-07-26 17:09:46.623994',37),(20,'assignment','word','sir,\n\nin assignment part only one file can upload.but in day 1,section 2,asgmnt 1 you put 2 activities .so i created it as 2 word document .i cant do it in single .so how can i upload these two?','2021-07-27 16:57:45.016546','2021-07-27 16:57:45.016546',117),(21,'Sir, i am not able to access day 3 classes as it is showing to complete assignments and tests,. I have already done it. Then why i am not able to access','word','Sir, i am not able to access day 3 classes as it is showing to complete assignments and tests,. I have already done it. Then why i am not able to access?','2021-07-28 16:40:15.536662','2021-07-28 16:40:15.536662',147),(22,'exams','word','i watched the class.took notes.studied well.then only iam attending the exam.iam sure that all answers are correct .because those questions are very simple. i know all those aspects earlier.but the marks are 2 or 3.when i improved, then also some questions are repeating, i marked correct answers.but marks are like that.why it is so?\n\nto confirm answers i googled it after exam and watched lectures once again.iam damn sure there is some problem.thats why iam asking','2021-07-28 20:48:21.754616','2021-07-28 20:48:21.754616',117),(23,'i couldnt find malayalam in translate','word','While translating a document in word i couldnt find malayalam in the reveiw option. How can i get malayalam into the language list?','2021-07-28 22:13:32.874564','2021-07-28 22:13:32.874564',81),(24,'Exam','word','Day 2\n\nBut in day 1 exam also i felt like that.but that\'s not sure','2021-07-29 11:17:38.089916','2021-07-29 11:17:38.089916',117),(25,'doubt regarding assignment','word','cant translate in to malayalam.my system doesnt support the malayalam language.what can i do?','2021-07-29 17:26:22.145802','2021-07-29 17:26:22.145802',117),(26,'Can i submit the assignments without some features','word','Iam doing my assignments in my mobile. I couldnot find  find features like drop cap,borders etc...','2021-07-30 16:36:48.895717','2021-07-30 16:36:48.895717',77),(27,'Submit two word documents together','word','How can we submit the word documents together in the assignment since it is mentioned in the submit option that only one submission is allowed?','2021-07-30 22:20:47.038136','2021-07-30 22:20:47.038136',136),(28,'How can we select a piece of text using keyboard','word','It was said that we can use Alt  button to assign alphabet to each command in MS Word, in case we dont have a mouse. But for making use of this command we have to select the piece of text to be edited, how can we select this piece of text in the absence of mouse.','2021-07-31 07:59:47.461877','2021-07-31 07:59:47.461877',47),(29,'Should I do multiple documents as assignment and submit and the issue is, I only see a single slot/chance for submission.','word','Assignment 1 of Part 2 of Day 1 :Create a birthday card/thank you card and an event invitation card using the MS word in-built template and format the characters in an attractive way using the character format commands.\n\nShould I create Birthday card, Thanks card as well as the event card or either any one of them?','2021-07-31 12:19:17.703440','2021-07-31 12:19:17.703440',34),(30,'test','word','in day 4 exam iam getting only 3 options.4th option is not visible.is that so?\n\ni marked the answers accodingly','2021-07-31 16:03:47.595227','2021-07-31 16:03:47.595227',117),(31,'can we add a blank page in word document containing a template','word','miss,\n\nin day 5 assignments ,1 st assignment have 2 parts.one resume making and conversion of 2-D in to 3-D.i made resume using template .if i want to add 2nd part of assignment that is conversion of 2-D in to 3-D in same document where i made resume ,then is that possible ?\n\nhere in assignment part only one submission is possible,right?\n\nso i think i have to include both parts in same document .then only it is possible to submit both parts of assignments.but the problem is that when ever i add one template in to document , i couldnt get any pages to do 2nd part.if i do it as separate document then it not possible to submit two documents.what can i do?\n\n\n\nthis question i was asked earlier regarding assignments in first day.but i dont understand the\n\nexplanation given .so that, here i explained this much.i think  now maam could able to understand my problem\n\nthank you maam','2021-08-01 12:15:02.005798','2021-08-01 12:15:02.005798',117),(32,'I have old version of 2007 ms office','word','Many features are missing in the old version so sometimes I am facing difficulties for completing assignment','2021-08-08 15:29:05.748657','2021-08-08 15:29:05.748657',43),(33,'Problem in attaching assignment','word','I cannot attach day 9 session two assignments. Can you help to sort this issue?','2021-08-09 09:20:22.032654','2021-08-09 09:20:22.032654',86),(34,'view tab','word','in my ms word there is draw tab is not available.in view tab immersive is not availabe.why?\n\nhow can i complete my assignments?','2021-08-11 14:24:31.786863','2021-08-11 14:24:31.786863',117),(35,'i need a help, i am not able to enroll, even after clicking the enroll now option','word','in more 2019 page, when I click enroll now, i was directed to the curriculum page, but at the top, it is again showing you are not enrolled yet? how to solve this','2021-08-12 15:16:25.957530','2021-08-12 15:16:25.957530',138),(36,'I am not able to view Day 14 class video. The assignments and test are already completed for Day 13.','excel','I am not able to view Day 14 class video. The assignments and test are already completed for Day 13.','2021-08-16 12:22:08.129425','2021-08-16 12:22:08.129425',147),(37,'Day 22','excel','Even though i completed all assignments in day 21 ,the day 22 didnt opened yet.  why?','2021-08-31 22:04:42.424163','2021-08-31 22:04:42.424163',117),(38,'Course','excel','The test of 21 also completed','2021-08-31 22:07:14.888525','2021-08-31 22:07:14.888525',117),(39,'I am not able to view the Day 27 Test questions . The class for the same day is attended and assignments are also completed. Is it any technical isue?','excel','I am not able to view the Day 27 Test questions . The class for the same day is attended and assignments are also completed. Is it any technical isue?','2021-09-01 19:49:21.864652','2021-09-01 19:49:21.864652',147),(40,'I couldnot view the questions for test (Day 27). I simply gave submit and the score appeared as zero. Therefore i clicked the improve score option, that too questions are not getting visible. What is the reason? Any technical issue from your part. I am not able to access Day 28 class','excel','I couldnot view the questions for test (Day 27). I simply gave submit and the score appeared as zero. Therefore i clicked the improve score option, that too questions are not getting visible. What is the reason? Any technical issue from your part. I am not able to access Day 28 class','2021-09-02 22:50:20.821441','2021-09-02 22:50:20.821441',147),(41,'Day 22 class','excel','Day 22 is not opened yet.why?\r\nI completed all my assignments and test in day 21.i asked same question one week before maam.but you didnt respond yet.in these days i am free and able to complete my classes but unfortunately it didnt open.in coming month i have exams at college.so plz respond maaam','2021-09-05 14:29:55.382650','2021-09-05 14:29:55.382650',117),(42,'not able to attend the classes from day 13','word','madam, i have completed all the assignments and tests of MS Word till class 12. when I try to attend class from day 13, its showing up a message to complete the previous assignments. Why is it so. in the performance sheet marks till day 12 is also shown.','2021-09-07 18:59:11.209411','2021-09-07 18:59:11.209411',81),(43,'Regarding assignment and next class','word','i have just submitted day 1 assignment, when can i see the next class, is it only afterthe correction of assignemts','2021-10-04 15:48:33.248529','2021-10-04 15:48:33.248529',138),(44,'I couldn\'t create a new style in MS word.','word','It\'s showing that a new style is created, but there is no formatting in it. The font style and size is not changing. Its coming as default. What to do?','2021-10-05 23:51:09.984271','2021-10-05 23:51:09.984271',134),(45,'i could not attend the class class 3rd onwards, donnow y','word','y cant i attend the class even if i had submitted the previous assignment','2021-10-08 09:41:58.513008','2021-10-08 09:41:58.513008',101),(46,'MY CUSTOM VIEW OPTION IS GREYED OUT SO I CANT HELP WITH THAT ASSIGNMENT .','excel','CUSTOM VIEW OPTION','2021-10-09 14:20:28.866609','2021-10-09 14:20:28.866609',91),(48,'Is it possible to include text and formula in a cell?','excel','like including a sum value through a formula next to a text of total in a single cell.','2021-10-13 20:49:52.390957','2021-10-13 20:49:52.390957',69),(49,'Maam the video uploaded is of very high quality is there any option to reduce its quality','word','Finds difficult to see the cls as data quickly exhausts','2021-10-15 16:51:08.455349','2021-10-15 16:51:08.455349',91),(50,'I couldn\'t use the mail merging option and many other options in mobile that I could access in laptop.','word','Is there any way to get them on phone?','2021-10-23 00:05:06.768209','2021-10-23 00:05:06.768209',134),(51,'assignments are not evaluated','excel','my assignments from day 15 are not evaluated. the performance sheet appears to be blank for these days.','2021-11-12 22:42:26.367930','2021-11-12 22:42:26.367930',81),(52,'I had attended assignments of day 1 and 2 but it is not evaluated yet','word','Even though I had attended day 2 assignments, day 3 is not accessing and assignments of day 1 and 2 is not evaluated yet','2021-11-14 14:44:44.640772','2021-11-14 14:44:44.640772',78),(53,'How to compare two worksheets?','excel','I have created 2 worksheets and opened them in different windows. now i have to compare and mark the differences in it.  How can i do it?','2021-11-15 19:41:11.864408','2021-11-15 19:41:11.864408',134),(54,'I cant find the tools options  and ribbon tabs in my outlook','outlook','All the options like files options etc that are showing in the cls are not there in my outlook how can i make them visible','2021-11-18 09:21:25.134975','2021-11-18 09:21:25.134975',91),(55,'Assignment related issues','outlook','Day 58 and Day 59 assignments are of MS-Access. But they are given under Outlook. Team kindly look into this issue. Also many questions in MS-Outlook are jumbled with the multiple choices of other questions.','2021-11-21 16:51:59.447399','2021-11-21 16:51:59.447399',45),(56,'Issues with assignments','outlook','Day 58 and Day 67 has same assignment. Same case with the Day 59 and Day 68.','2021-11-21 17:13:59.797753','2021-11-21 17:13:59.797753',45),(57,'A MISTAKE IN THE ASSIGNMENT','word','IN THE 8TH DAY 1st ASSGNMENT OF HEADERS AND FOOTERS, INSTEAD OF A 5 PAGE DOCUMENT I ACCIDENTLY UPLODED A 2 PAGE DOCUMENT. WHAT SHOULD I DO?','2021-12-04 12:44:50.343555','2021-12-04 12:44:50.343555',37),(58,'Unable to Access Day 69 onwards','access','There is no content available from Day 69 onwards','2021-12-14 21:46:01.946231','2021-12-14 21:46:01.946231',45),(59,'69th onwards there are no videos','access','Day 69 onwards no videos are there','2021-12-14 22:16:03.346560','2021-12-14 22:16:03.346560',91),(60,'Madam its told to be 90days course what about rest of days','access','Rest of the days','2021-12-16 09:00:53.364629','2021-12-16 09:00:53.364629',91),(61,'Regarding certificate','access','Kindly tell us the tentative date for getting the certificate for the completed course.','2021-12-16 09:56:40.090131','2021-12-16 09:56:40.090131',45);
