INSERT INTO `ask_an_expert_response` VALUES (1,'It was a technical issue from our part. We have fixed it. Please check the sessions again.','2021-08-16 21:22:29.074237','2021-08-16 21:22:29.074237',NULL,36,1),(25,'MORE 2019 course is based on MS Office 2019 version. There are a lot more features in the 2019 version comparing to the 2007 version. So, please upgrade your 2007 version to the 2019 version otherwise you might face issues as the course progresses.','2021-07-27 22:10:13.920642','2021-07-27 22:10:13.920642',NULL,19,152),(26,'If there are two assignments in a section you can open it as two different questions. So, each assignment has a seperate upload button available. You can upload each activity separately.','2021-07-27 22:13:24.121772','2021-07-27 22:13:24.121772',NULL,20,152),(27,'Please check whether you are using MS Word 2019 version. In 2019 version you will get Malayalam language','2021-07-28 22:24:33.824148','2021-07-28 22:24:33.824148',NULL,23,152),(28,'Can you please tell me in which day you are facing the problem with?','2021-07-28 22:26:13.180131','2021-07-28 22:26:13.180131',NULL,22,152),(29,'You have chosen to improve your grade obtained in the test for Day 2. You have to complete Day 2 including improvements to move on.','2021-07-29 05:44:57.557766','2021-07-29 05:47:05.997777',NULL,21,1),(30,'Try downloading the language pack from the Microsoft Support website. Please do google about how to download the language pack from Microsoft and try downloading it. Mostly you will be able to download and will be able to translate it into Malayalam.','2021-07-30 09:27:32.615868','2021-07-30 09:27:32.615868',NULL,25,152),(31,'Okay. Will connect with the technical team and let you know as soon as possible.','2021-07-30 09:28:28.449656','2021-07-30 09:28:28.449656',NULL,24,152),(32,'I have cross-checked all the questions with their answers. It was all marked correctly.  There is no error in the answers given on the server.','2021-07-30 09:35:11.090225','2021-07-30 09:35:11.090225',NULL,24,1),(33,'Please try to do the assignments with all the features. Then only we consider the assignment as completed.','2021-07-31 23:58:29.173356','2021-07-31 23:58:29.173356',NULL,26,152),(34,'If there are two sections in a day\'s assignment then you can open both assignments separately. And you will get separate upload buttons for every assignment.','2021-08-01 00:00:04.843748','2021-08-01 00:00:04.843748',NULL,27,152),(35,'Press shift + right arrow key for selecting the text letter by letter and Press ctrl + shift + right arrow key for selecting word by word','2021-08-01 00:01:33.672138','2021-08-01 00:01:33.672138',NULL,28,152),(36,'No do any one them','2021-08-01 00:04:12.294751','2021-08-01 00:04:12.294751',NULL,29,152),(37,'Will check with the technical team and let you know as soon as possible','2021-08-01 00:04:58.594904','2021-08-01 00:04:58.594904',NULL,30,152),(38,'I could not find any problems with it. Could you please check with your friend, if they have the same problem?','2021-08-01 07:42:41.293147','2021-08-01 07:42:41.293147',NULL,30,1),(39,'okay. Do the resume making and upload it. The 2nd part is the conversion of 2d to 3d, just do it for your understanding. Do not upload it.','2021-08-02 17:20:50.558811','2021-08-02 17:20:50.558811',NULL,31,152),(40,'there is no other way. You have to upgrade your MS Office version to 2019. Otherwise, when the course progresses you will face more difficulties.','2021-08-12 13:56:48.530525','2021-08-12 13:56:48.530525',NULL,32,152),(41,'Will let you know after contacting with the technical team','2021-08-12 13:57:33.448842','2021-08-12 13:57:33.448842',NULL,33,152),(42,'Make sure you are using the MS Word 2019 version. All these features are available only in the latest versions like Word 2016 and Word 2019','2021-08-12 13:58:31.992437','2021-08-12 13:58:31.992437',NULL,34,152),(43,'You have already submitted that assignment. It was also graded','2021-08-12 14:31:02.090344','2021-08-12 14:31:02.090344',NULL,33,1),(44,'Please try again. It probably was a network difficulty, as there were no errors to be found with the system. Please let us know if the problem continues for you.','2021-08-12 15:43:10.875311','2021-08-12 15:43:10.875311',NULL,35,1),(45,'It was a slight technical issue on our part. Sorry for the inconvenience.','2021-09-05 03:35:22.220102','2021-09-05 03:35:22.220102',NULL,40,1),(46,'You can access your daily assessment questions now.','2021-09-05 03:36:35.361723','2021-09-05 03:36:35.361723',NULL,40,1),(47,'You clicked yes when you were prompted for improvement on day 12. Attend the improvement and try again.','2021-09-12 12:14:06.766576','2021-09-12 12:14:06.766576',NULL,42,1),(48,'Hi, Vismaya. For creating a new style. \r\n1. Home tab-->styles-->Click on More option\r\n2. then click Create a Style--> give a name to style\r\n3. click on modify button---> you can see window there you can give all formats like font style, size, color, etc\r\n4. then click ok\r\n5. After that you select your new styles from the style group, then type your content in the document area.\r\n\r\nKindly do these steps. or watch our word-class 2 again\r\nThank you','2021-10-06 11:22:05.488232','2021-10-06 11:22:05.488232',NULL,44,153),(49,'No, You will be able to attend day 2 if you\'ve submitted all the assignments, passed the exam, provided the next day is open on your course dashboard. In the case of daily tests, remember to complete improvement, if you have chosen to improve your score at the end of the exam.','2021-10-08 10:54:57.633384','2021-10-08 10:54:57.633384',NULL,43,1),(50,'You should also attend the tests for each day and obtain 50% or above.','2021-10-08 10:59:07.740715','2021-10-08 10:59:44.757449',NULL,45,1),(51,'Hi, Sandra, We can use the Custom view option in excel in the View tab --> custom views.\r\n\r\nGenerally, if we use a custom view, it does not show the greyed option.\r\n\r\nFirst, you check your excel is in normal mode or Compatibility mode. Compatibility Mode disables certain features.\r\nTo exit from the Compatibility Mode, you\'ll need to convert the workbook to a current version type. \r\nTry it ... Then watch our Excel class 17 again.\r\nThank you.','2021-10-13 11:29:38.570472','2021-10-13 11:29:38.570472',NULL,46,153),(52,'Reduced quality means you can\'t really see the text. That\'s why the videos are set to high quality. We will update the issue on the next update to the site.','2021-10-21 11:58:19.719631','2021-10-21 11:58:19.719631',NULL,49,1),(53,'Hi Vismaya, kindly explain the problem in full detail.','2021-10-25 11:46:30.552689','2021-10-25 11:46:30.552689',NULL,50,153),(54,'Hi Aashiq, Yes you can use text and numbers in a formula.','2021-10-25 11:50:09.509899','2021-10-25 11:50:09.509899',NULL,48,153),(55,'Please check your email. Your assignment has lots of problem. You can find all the details in the email. kindly read that mail and get back to me for further clarification.','2021-11-13 23:03:48.420090','2021-11-13 23:03:48.420090',NULL,51,153),(56,'Hi, Jyoti. Your assignment is evaluated. please check it','2021-11-15 12:24:52.637444','2021-11-15 12:24:52.637444',NULL,52,153),(57,'Roshni you are sending the wrong assignments DAY 15 assignment please check and check all other assignments also.','2021-11-15 13:41:13.016531','2021-11-15 13:41:13.016531',NULL,51,153),(58,'Hi vismaya, I will clarify your doubts so Please contact 9074717536(Kalpana)','2021-11-17 12:23:50.725877','2021-11-17 12:23:50.725877',NULL,53,153),(59,'Hi Sandra, Your file, home...etc ribbon may be in the unpinned state. so you pin it. you can show all the ribbons','2021-11-18 13:30:46.639513','2021-11-18 13:30:46.639513',NULL,54,153),(60,'please contact this number 9497183988(kalpana)','2021-11-20 12:45:59.201451','2021-11-20 12:45:59.201451',NULL,51,153),(61,'All the issues are cleared','2021-11-26 16:06:58.780373','2021-11-26 16:06:58.780373',NULL,55,153),(62,'All the issues are cleared','2021-11-26 16:07:09.695527','2021-11-26 16:07:09.695527',NULL,56,153),(63,'No problem. we will delete that link and you can upload the assignment again.','2021-12-06 11:20:20.000835','2021-12-06 11:20:20.000835',NULL,57,153),(64,'check your 8th day  assignment link','2021-12-06 12:50:54.430228','2021-12-06 12:50:54.430228',NULL,57,153),(65,'Hi Sandra,\r\n                Only 68 classes are there.','2021-12-15 14:25:00.962517','2021-12-15 14:25:00.962517',NULL,59,153);
