INSERT INTO `courses_assignment` VALUES (1,'MS Word First Assignment','Open a blank document in MS Word and type a message as follows:\n\n\n\n‘This document is a sample text for MS Word. It can be used for testing navigation in MS Word. This content will get approval only after formatting and editing.’ \n\nAnd give and bold and italics font style to this content without using the mouse. Either use the shortcut or navigation for that. And save the file by naming it as ‘Sample Document’ on your desktop.','',1,2),(2,'Templates','Create a birthday card/thank you card and an event invitation card using the MS word in-built template and format the characters in an attractive way using the character format commands.','',1,5),(3,'Find and Replace','Create a sample text in MS word document with 4 paragraphs and 5 sentences each and then find a word and replace that word with another word. Mention the word  you\'ve found and the word you\'ve replaced at the end of the document.','',1,5),(4,'Create a document in 2 pages','Create a document in 2 pages with 4 or 5 paragraphs (in justified alignment) and add borders and shading to important paragraphs. Give line spacing 1.5 and give drop cap for the first letter in the document.','',1,3),(5,'Bullets and Numbering','Take a Magazine/Newspaper, select 20 random words, and type those in your MS word document by giving bullets or numbers. Then sort those words in descending order.','',1,3),(6,'Styling and Command Group','Create a new style of your own and add that into your style command group in MS Word. Make a ‘Congratulations’ message to your friend with the new style that you have created','',1,4),(7,'Create a Course Outline','Create a Course Outline for any of your university courses.','',1,4),(8,'Thesaurus','Prepare a one-page document OR copy an article from an English magazine/Newspaper and translate that article into Malayalam. Try using the synonyms of some words using the thesaurus command.','',1,6),(9,'Autocorrect','Find out some words that are not auto-corrected by MS Word and add that in the back-end.','',1,6),(10,'Templates','Create a Congratulations Template and Save it as a template.','',1,7),(11,'Ribbon','Customize your ribbon by adding a new tab and commands. Either insert the screenshots of your customized ribbon into the file or type in the steps you used for customizing your ribbon','',1,7),(12,'Table Creation and Styling','Create a table and add a style to that. Give heading as Students Name, Id number, their class and total marks and add the details.','',1,8),(13,'Add Columns','Add an additional column named Guardian name in between Student name and ID number columns and add the details.','',1,8),(14,'Tables Complete Assignment','Create a table with 8 rows and 4 columns and give a style. Add a common heading to the table as ‘Employee Database Information’. \n\nAdd Employee name, Month of Joining, Employee ID number and Salary as headings and add the details. Resize the columns using distribute column command. Calculate the total salary.','',1,9),(15,'Two part Assignment','a. Prepare your resume using the in-built template and insert your picture in that. \n\n\n\nb. Insert any picture and convert that 2-D image to a 3-D image.','',1,10),(16,'Text Wrap and WordArt','Prepare a 2-page document and insert a shape inside the text by wrapping the shape in a way that the shape should be surrounded by the text. Add a text inside the shape and format it with WordArt.','',1,10),(17,'Download and Insert','Download and insert a video file and a PPT into your word document from the internet.','',1,11),(18,'Charts','Insert a pie chart representing the failed and passed students in the university exam into your MS word file and edit the heading as ‘Pass Percentage’. Edit the quarter headings and data as follows: \n\n\n\nDistinction % = 50%, Above 50 % = 25%, Below 50 % = 15%, Failed % = 10%\n\n\n\nAlso change the chart colour as per your interest.','',1,11),(19,'Project Report','Prepare a project report and add a cover page for that. Give the title of the project in your cover page. Add a link of any of the file in your system and bookmark 2 headings and one paragraph from your project report. Give cross-reference to any of the headings in your report. And add 5 comments also.','',1,12),(20,'Leave Application','Prepare a leave application letter to your principal/boss asking for leave. Add present day date & time and a signature line with your name & designation/class.','',1,12),(21,'Page color and Border','Prepare a document of 5 pages and give page colour and borders to all the pages.','',1,13),(22,'Headings and sub-headings and Document formatting','Prepare a document of 8 pages with Headings and sub-headings and give styles for your headings and sub-headings. Then add a theme change colour and font and format the whole document.','',1,13),(23,'Watermark','Prepare a document of 4 or 5 pages and add a text or picture watermark in it.','',1,14),(24,'PDF and Webpage','Prepare a word document and convert it into a pdf format and to a webpage.','',1,14),(25,'Page Resize and Margins','Prepare a document of 4 or 5 pages and add a narrow margin for that document. And resize your document to A5 page size.','',1,15),(26,'Magazine Article','Prepare a magazine article and give a heading. Then divide the document into two columns and give the heading common to both the columns.','',1,15),(27,'Header & Footer and page number','Prepare a 5-page document and add headers and footers as per your interest and add page numbers on the margin.','',1,16),(28,'Header and Footer','Prepare an 8-page document and add a picture/company or university logo in the middle of the header and add page number on the top right corner of the header. Add author’s name on the left side of the header. Add date & time on the left end and company/university name on the right end of the footer.','',1,17),(29,'Table of Contents','Prepare a project report with a main title and 6 or 7 headings. Also add page numbers to all the pages. Add a cover page as per your interest. Then add table of contents after the cover page. Add 4-foot notes on every even numbered pages.','',1,18),(30,'Citations, bibliography and table of contents','Prepare a sample project report with tables, figures, shapes, and pictures etc. and caption it. Add 7 or 8 citations in your document. Then add a bibliography page at the end of your document. Add a list of figures and tables for your document after the table of contents page.','',1,19),(31,'Mail Merge Assignment','Prepare a letter and send it to 15 people using mail merge command in MS Word. After combining all the 15 letters, click on Finish & Merge button and then upload the merged file with all the 15 letters. Make sure  to check if all the letters are in the same document file.','',1,20),(32,'Comments','Prepare a 4-page document and add some comments in that. Also turn on track changes and do some editing in your document with all markups on.','',1,21),(33,'Restrict Editing and highlighting','Prepare a 2-page document with 6 paragraphs. Restrict editing for the 2nd, 4th and 6th paragraphs. Then unlock the restriction and highlight the important sentences in your document using the ‘Draw’ tab.','',1,22),(34,'View tab Assignment','Prepare a document and adjust the column width to moderate using the immersive reader command. Show gridlines in your document and move the page side to side.','',1,23),(35,'Letter','Prepare a formal letter format and record it on macro and run in a new MS Word file.','',1,24),(36,'Prepare an enquiry','Prepare an interactive enquiry form with the following headings:\n\nFirst Name, Last Name, Address, Date of Joining, Email ID, State, Country, Sex and Qualifications.','',1,25),(37,'Seminar Report','Prepare a seminar report in MLA format.','',1,25),(53,'Sample Excel Assignment','Open a blank workbook and type the names of all the tools in the MS Excel interface in column A and save the file by giving 