'images/assignments/19-1.png',1,38),(69,'Logical Formulas - 2','Open a blank workbook and create a spreadsheet as follows. Calculate the remarks of each student as per the university criteria given.','images/assignments/19-1-2.png',1,38),(70,'Commission Calculation','Open a new workbook and create a spreadsheet as follows. Calculate the commission for each sales person with condition given by the company.','images/assignments/19-2-1.png',1,39),(72,'Taxing','Open a new blank workbook and create a spreadsheet as follows. Calculate the Total cost of each item & and the tax amount with 7% tax on the total cost.\r\nAnd trace the Precedents of tax amount.','images/assignments/20-1.png',1,40),(73,'Proper, Right & Trim functions','Open a blank workbook and create a spreadsheet as follows. And apply Proper, Right & Trim functions to clean the data.','images/assignments/20-2-1.png',1,41),(74,'Concatenate function','Open a blank workbook and create a spreadsheet as follows and use concatenate function to combine the data into one column using comma as a separator.','images/assignments/20-2-2.png',1,41),(75,'Net Working Days','Open a new blank workbook and create a spreadsheet following the instructions:\r\n•	Calculate the net working days of an employee in a company with a financial year calculated from 01/04/2021 to 31/03/2022.\r\n•	The holidays as per the company calendar is as follows:\r\n	15-08-2021 – Independence Day\r\n	25-12-2021 – Christmas\r\n	01-01-2022 – New Year\r\n	26-01-2022 – Republic Day','',1,42),(76,'Date Function Assignment - 2','Open a new sheet in the same workbook. Calculate the exact age of Mr. Jeevan Mathew whose date of birth is 15-12-1987. Find out Mr. Jeevan Mathew is how many years, how many months & how many days old?','',1,42),(77,'Name Range Assignment','Open a blank workbook and create a spreadsheet as follows. And calculate the sum, minimum, maximum and average of the numbers. Find out the count of numbers and text and also find out the number 