data and lock the entire sheet using Protect cells.','images/assignments/25-1-1.png',1,50),(87,'Hyperlink','Open a blank workbook. Create a spreadsheet as follows. Create Hyperlink for all the file numbers to different websites.','images/assignments/25-2-1.png',1,51),(88,'Print Page Assignment','Open a blank workbook and create a spreadsheet as follows or download a lengthy list like this from the internet. Do the page setup like keep it in A4 size, collated, portrait orientation and in wide margins. And also, every page should get the column headings when it gets printed. Then take the print outs, scan and upload the printed copy as your assignment.','images/assignments/26-1-1.png',1,52),(89,'Headers and footers','Open a blank workbook and create a spreadsheet as follows or download a lengthy list like this from the internet.\r\nAdd headers and footers to all your pages. Header should contain the page number and the file name. And the footer should contain the Date and the time.','images/assignments/26-2-1.png',1,53),(90,'Sorting - 1','Open a blank workbook and create a spreadsheet as follows and sort the data with respect to the colour as per the order given below.\r\n1 – Red\r\n2 – Yellow\r\n3 – Green\r\n4 – Blue','images/assignments/27-1-1.png',1,54),(91,'Sorting - 2','Open a blank workbook and create a spreadsheet as follows. Sort the data with respect to region and sales person. Take Major sort as region.','images/assignments/27-1-2.png',1,54),(92,'Data Filter','Open a blank workbook and create a spreadsheet as follows. Filter in such a way that you need to see only the record of Stephen in South region in the same worksheet in a different cell region.','images/assignments/27-2-1.png',1,55),(93,'Advanced Filtering','Open a blank workbook and create a spreadsheet as follows. Filter in such a way that you need to see only the records of sales that happened after 17-07-2021 into a new sheet.','images/assignments/27-2-2.png',1,55),(94,'Table Assignment','Open a blank workbook and create a spreadsheet as follows. Convert this as a table and name the table as “My Table”. Remove the duplicates from the table and then upload the document as the assignment.','images/assignments/28-1-1.png',1,56),(95,'Subtotal Calculation','Open a blank workbook and create a spreadsheet as follows. Calculate the subtotal of each region and upload the file.','images/assignments/28-2-1.png',1,57),(96,'Column Achart Assignment','Open a new blank workbook and create a spreadsheet as follows. Insert a column chart for the data and change the chart title to ‘Amazon Summer Sales 2021’.','images/assignments/29-1.png',1,58),(97,'Charts Assignment','Open a blank workbook and create a spreadsheet as follows. Insert a column v/s line chart for the above-mentioned data and change the chart title to ‘Income & Expenses’. Change the font colour and also show the secondary axis.','images/assignments/29-2.png',1,59),(98,'Scatter Chart Assignment','Open a blank workbook and create a spreadsheet as follows.  Insert an XY scatter chart and change the chart title to ‘X to Y’ and then change the font colour in the chart. Display all the formulas inside the chart and calculate the slope, Y-intercept and R^2 value manually and check whether the answer is right. Manually checked calculations should be done in the same worksheet.','images/assignments/30-1.png',1,60),(99,'Spark Line Chart Assignment','Open a blank workbook and create a spreadsheet as follows. Insert sparkline chart above/below each month. Insert a Sparkline column chart for January, Win/loss chart for February and a line chart for March month.','images/assignments/30-2.png',1,61),(100,'Pivot Table Assignments -1','Open a blank workbook and create a spreadsheet as follows. Insert a Pivot table for the data as shown below, with all the headings and signs.','images/assignments/31-1_vUjVSYI.png',1,62),(101,'Pivot table Assignment - 2','Open a blank workbook and create a spreadsheet as follows. Create a Pivot table as shown below.','images/assignments/31-2.png',1,63),(102,'Pivot table Assignment - 3','Open a blank workbook and create a spreadsheet as follows. Create a Pivot table with region as row header and sales person as column header. Then insert a timeline for your pivot table and filter with months. Show only the records of September month 2021 in your pivot table. Then change the colour of your timeline.','images/assignments/32-1.png',1,64),(103,'Pivot table Assignment 4','Open a blank workbook and create a spreadsheet as follows. Create a pivot table for the data and insert a slicer. And filter your data in such a way that it shows only the record of East region. Then, change the colour of your timeline.','images/assignments/32-2.png',1,65),(104,'Consolidation Assignment','Open a new blank workbook and create 3 spreadsheets as shown below in 3 different sheets in 3 different positions.  Calculate the sum of each person in each month in all the 3 sheets using consolidate command and give the link to the source data in such a way that if any change is given to the source data should get reflected in the answer as well.','images/assignments/33-1.png',1,66),(105,'Conditional Formatting Assignment','Open a new blank workbook and create a spreadsheet as follows. \r\n•	Highlight the numbers between 30 & 70 in the first column.\r\n•	Highlight the text that contains ‘Tue’ from the 2nd column.\r\n•	Enter the dates from the present month and also from the next consecutive month (depends on when you do this assignment) in the date’s column. Then highlight those dates that come in the next month.\r\n•	Highlight the top 3 items from the last column.','images/assignments/33-2.png',1,67),(106,'Advanced conditional formatting Assignment','Open a new blank workbook and create a spreadsheet as follows. Then highlight the entire record of ‘Cosmetics’ using advanced conditional formatting.','images/assignments/34-1.png',1,68),(107,'Data Validation Assignment','Open a new blank workbook and create a spreadsheet as follows.\r\n•	Insert data validation in ‘Target Quantity’, ‘Target Date’ and Country columns.\r\n•	Target Quantity – Whole numbers between 100 & 200\r\n•	Target Date – Date between present day and the same day in the next month (depends on when you do this assignment)\r\n•	Country – Add a drop-down list in the ‘Country’ column with country names India, China, USA, Singapore, Thailand, Malaysia, Canada, Australia, Russia, Japan, UAE, United Kingdom, New Zealand, Ireland & France. Then add each country to each person.\r\n•	Customize the error message for the first column: Add title as ‘Not Valid’ and message as ‘Kindly enter numbers between 100 & 200’','images/assignments/34-2.png',1,69),(108,'Dependent Dropdown Assignment','Open a blank workbook and create a spreadsheet as follows. Create another two columns in the same worksheet as Countries & Cities and add a drop-down & dependent drop-down list for both the columns.','images/assignments/35-1.png',1,70),(109,'Weather Forecast','Open a blank workbook and import the next 25 days weather forecast of your city from the website. To your excel sheet.','',1,71),(110,'What If Analysis','Open a blank workbook and create a spreadsheet as follows. Calculate the amount of each item for 5kg, 10kg, 20kg, 25kg & 30kg using What-IF analysis.','images/assignments/36-1.png',1,72),(111,'Production Increase Assignment','Open a blank workbook and create a spreadsheet as follows.\r\n•	Task 1 - Calculate the income, expense & also profit of each item.\r\n•	Task 2 - The company demands to increase the profit by 450Rs/- for each item by not increasing the selling price but by increasing the unit production. So, calculate the no: of units to be sold if you want the profit of each item 450Rs/- more than the actual profit amount.','images/assignments/36-1-2.png',1,72),(112,'Power Query Assignment','Open a blank workbook and create a spreadsheet as follows with some extra and unwanted spaces. \r\n•	Convert this data to a table. \r\n•	Then using power query editor, delete the unwanted spaces and make all the characters in capital letters.\r\n•	Then combine all the texts in 3 columns to one column.','images/assignments/36-2.png',1,73),(113,'Shortcuts - 1','Open a blank workbook and create a spreadsheet as follows. Use the shortcuts and do the below-mentioned tasks.\r\n•	Convert this data into a table\r\n•	Make all the characters into Bold & Italics\r\n•	Find ‘Mon’ from the source data and replace it with the word ‘Work’\r\n•	Insert hyperlink to Feb, May & Oct months to some random websites\r\n\r\nAdd all the shortcuts you used at the end of the document.','images/assignments/37-1.png',1,74),(114,'Shortcuts - 2','Open a blank workbook and create a spreadsheet as follows. \r\n•	Insert data validation using the shortcut key in ‘Target Quantity’, ‘Target Date’ and Country columns.\r\n•	Target Quantity – Whole numbers between 100 & 200\r\n•	Target Date – Date between present day and the same day in the next month (depends on when you do this assignment)\r\n•	Country – Add a drop-down list in the ‘Country’ column with country names India, China, USA, Singapore, Thailand, Malaysia, Canada, Australia, Russia, Japan, UAE, United Kingdom, New Zealand, Ireland & France. Then add each country to each person. Add all the shortcuts you used at the end of the document.','images/assignments/37-2.png',1,75),(115,'Shortcuts - 3','Open a new blank workbook and create a spreadsheet as follows.\r\nRepeat the names and the numbers towards cells downwards using a shortcut (Drop-down list).\r\nAlso, list the shortcuts you\'ve used at the end of the document.','images/assignments/38-1.png',1,76),(116,'Shortcuts - 4','Open a new blank workbook and create a spreadsheet as follows. Insert a chart using the shortcut key for the above data. Also, list the shortcuts you\'ve used at the end of the document','images/assignments/38-2.png',1,77),(117,'Shortcuts - 5','Open a blank workbook and create a spreadsheet as follows.  Calculate the sum using the shortcut key.\r\nAlso, list the shortcuts you\'ve used at the end of the document.','images/assignments/39-1.png',1,78),(118,'Shortcuts - 6','Open a blank workbook and create a spreadsheet as follows. Calculate the sum of the first two columns in the third column and multiply the sum with and find out the answer in the 4th column.  Also, list the shortcuts you\'ve used at the end of the document.','images/assignments/39-2.png',1,79),(119,'Shortcuts - 7','Open a blank workbook and create a spreadsheet as follows. Convert the Data 1 column into currency format, Data 2 column to time format and data 3 columns to number format using only the shortcuts.  Also, list the shortcuts you\'ve used at the end of the document.','images/assignments/40-1.png',1,80),(120,'Shortcuts - 8','Open a blank workbook and create a spreadsheet as follows. Create names from selection for the above data (Name Range) using the shortcut key. Also, List all the shortcuts used at the end of the assignment.','images/assignments/40-2.png',1,81),(121,'PowerPoint Basics','Open an MS PowerPoint file and create a Title slide and type ‘CONGRATULATIONS’ in it. Make it Bold and in red colour. Add some notes below that slide saying that to whom you are sending this message and save the file and upload it as your assignment.','',1,82),(122,'PowerPoint Basics - 2','Prepare a basic presentation about any topic you like which contains 10 slides with the first slide as the Title slide. Then change the layout of your slide from 2nd slide as per your requirement. Insert a picture in any of the slides from the ‘Insert picture’ command inside the slide. Group your slides into 3. Name the first group of 3 slides as ‘Intro’ next 4 slides as ‘Content’ and the last 3 slides, group it as ‘Conclusion’.','',1,83),(123,'Presentation Editing','Open a new PowerPoint file and create a basic presentation with 12 slides. Make the 1st slide the Title slide with font size 40 and bold. Then after completing the presentation increase the font size to the next size of all the slides from the 2nd slide using the shortcut key. Then make all the text in the Upper case and at the last slide mention the change of the font size (you made from which size to which size).','',1,84),(124,'Rearranging Slides','Copy the same presentation that you have made in section 1 of this day and add 2 new slides into it with content. Then rearrange the slides (change the order). Add a new slide at the end and mention the slide numbers of newly created slides in it.','',1,85),(125,'Converting Powerpoint to image file','Open a new PowerPoint file and create a basic presentation with 10 slides. Convert this PowerPoint file into an image file and upload it as your assignment.','',1,86),(126,'Mouse Click and Mouse Over Assignment','Open a new PowerPoint file and insert 2 images in the 1st slide. And give a hyperlink to open 2 different web pages with Actions on mouse click. Also, insert 2 shapes in the 2nd slide and give a hyperlink to open 2 different web pages with Actions on mouseover.','',1,87),(127,'Smart Art Assignment','Open a new PowerPoint file and type 4 country names and 3 cities each for each country and create a smart art graphic for the text in a hierarchy model and upload that file as your assignment.','',1,88),(128,'Tables Assignment - 1','Open a new PowerPoint file and create a table in the slide which contains 4 columns and 8 rows. Column headings should be as follows:\r\n•	First Name\r\n•	Last Name\r\n•	Student ID No:\r\n•	Marks Out of 100\r\nAdd 8 students names in the row and their respective ID no: and the marks obtained. Change the style of the table and highlight the banded rows.','',1,89),(129,'Tables Assignment - 2','Open a new PowerPoint file and create a table as follows. Then add a column to the right side of the number column. Merge the cells in that column and type ‘DATABASE’ in it. And give the text direction as ‘Stacked’.','images/assignments/45-2.png',1,90),(130,'Hyperlinks','Open a new PowerPoint file and add 2 slides. Insert an image in the first slide and give a hyperlink to any webpage. Insert a shape to the 2nd slide and give a hyperlink to a different webpage. (Use the shortcut for hyperlinking).','',1,91),(131,'Hyperlinks - 2','Open a new PowerPoint file and create a basic presentation with 10 slides. Insert an image to the 3rd slide you create and then hyperlink to that image in such a way that when you click that image your 9th slide should open.','',1,92),(132,'Header and Footer','Open a new PowerPoint file and copy the same presentation that you have created in section 1 and then add-footer for all the slides except the first slide. The footer should include the slide number and also the date & time. Upload this file as your assignment.','',1,93),(133,'Video in Powerpoint','Open a new PowerPoint file and insert a video file in your first slide. In the 2nd slide, mention the shortcuts to play/pause, to stop, to mute/unmute and to fast forward the video file.','',1,94),(134,'Editing Video in PowerPoint','Open a new PowerPoint file and insert the same video file that you have inserted in the section 1 assignment. Now, trim the video into a shorter one and add bookmarks in 3 different points in the trimmed video file.','',1,95),(135,'Objects in PowerPoint','Open a new PowerPoint file and in the 1st slide, insert a word file as a document. Then in the 2nd slide, insert an excel file as an icon and also a document in the 3rd slide insert a notepad file as a document. Upload this file as your assignment.','',1,96),(136,'SlideShow','Open a new PowerPoint file and create a basic presentation with 12 slides and hide the 3rd, 5th, 8th and 11th slides in your presentation. Save this and upload this as your assignment.','',1,97),(137,'PowerPoint Photo Album','Download random 25 images from the internet to your device. Then open a new PowerPoint file and create a photo album using those images in your system. There should be 2 images in a slide and the images should be rounded rectangle format.','',1,98),(138,'Image Formatting','Open a new PowerPoint file and insert 3 images in 3 different slides and convert all the 3 images into 3D images by removing the background.','',1,99),(139,'Insertion and Formatting of Shapes','Open a new PowerPoint file and insert 2 different shapes into the slide. Format the shapes by filling them with different colours, add borders and border colours. Then add some text into the shapes and give word art effects to the text. Rotate the shape and save the file. Upload this saved file as your assignment.','',1,100),(140,'Charts Assignment','Open a new PowerPoint file and insert a column chart into it. Change the sample data as follows. Change the chart title to ‘Summer Sales 2021’. Save and upload this file as your assignment.','images/assignments/50-2.png',1,101),(141,'Comparing and Merging','Open 2 PowerPoint files and create one slide each with similar content. In the 2nd file add some formatting like changing the font colour, insert images or shapes, change the font style and size etc. Then compare and merge both the files and accept all the changes in the 2nd file to the 1st file. Add a new slide into the merged file and mention what all changes have been accepted from the 2nd file.','',1,102),(142,'Transitions and Animations','Open a new PowerPoint file and create a presentation about any random topic with 15 slides. Add images and shapes in some slides as per your requirement. Give each transition to each slide and also add animation to the elements in the slide as per your interest. Save the file and upload this as your assignment.','',1,103),(143,'Outlook Final Assignment','Open MS Office-Outlook, contacts list page. Create a New Group named ‘Office contacts’\r\nand create a folder belonging to the group, name it as ‘Top senior management’. Add any of the 5\r\ncontacts from your main contacts list with specifying job title as ‘Senior Management’ to the folder\r\n‘Top senior management’. Export the 5 contacts from the added folder as a file and the file type\r\nshould be ‘CSV/ Comma Separated Value’ while exporting. Save the file and upload it as your\r\nassignment.','',1,114),(144,'Access Asignment','A local medical practice has asked you to help design a simple database to track\r\nthe cost of treating patients. Their paper-based system means that it takes a long\r\ntime to work out how much they are spending. What do we need to be able to\r\ndo?\r\nTasks\r\n1. Decide what the main table names should be.\r\n2. Note down the fields that belong to each table.\r\n3. Choose an appropriate data type for each field.','',1,115),(145,'Access Assignment','Using the same technique as used to build the Patients table, create the Treatments table.\r\nTasks\r\n1.create a new table in Design view(CREATE > Table design).\r\n2.Enter the fields as in the table below.\r\n3.Nominate the ID field as primary key\r\n4.save the table and call it Treatments.','images/assignments/Screenshot_2021-11-02_093815.png',1,116),(146,'Access Assignment','Using any combination of criteria or techniques work out the following:\r\nTasks\r\n1.Find out men patients in Patients table who are less than 35 years old.\r\n2.Find out the people from the EN56 post code.\r\n3.Calculate the total cost of treating all patients.\r\n4.How many surnames start with the letters \'We\'(any number of letters can follow).\r\n5.How many surnames contain the letters \'so\' at any part of the name.\r\n6.How many first names end with \'n\' (any number of letters can precede).','',1,117),(147,'Access Assignment','a) Create an access database “Customer\" containing a table named ‘Mobile’ with the following fields.','images/assignments/64-1.png',1,118),(148,'Access Assignment','b) Populate the table with following data records.\r\nc) Execute the following SQL queries  \r\n\r\ni) Select the MobileName with company as Nokia.\r\nii) Select record on the basis of MobileName using parameter query.\r\niii) Update the price of mobile named Asha to 5000.\r\nvii) Remove the record of Galaxy.','images/assignments/64-2.png',1,118),(149,'Access Assignment','Create a Student database having two tables “Student” and “Department”\r\n\r\nTasks\r\na.	Create a relationship between the tables.\r\nb.	Display students who belong to “ComputerScience” department.\r\nc.	Select the DeptName of StudentID 104.','',1,119),(150,'Access Assignment','Create a Form \r\n\r\nTasks \r\na.	Create a single item form based on the Patients table, save it as “Patient Form”.\r\nb.	Create multiple items form based on the Patients table, save it as “Patient List”.\r\nc.	Modify the Patient List form by removing the Address Line 1 and Post Code fields.\r\nd.	Resize the fields by reducing the height so that you can see more people on the screen.\r\ne.	Save your changes.','',1,120),(151,'Access Assignment','Create a Report \r\nBuild a report using the wizard!\r\n\r\nTasks \r\n1.	Build a report based on the Patients table \r\n2.	Group the report by gender.\r\n3.	Insert a Logo.\r\n4.	Save the report as “Grouped patient list”.\r\nSwitch to layout or design view and resize any fields whose boxes are too narrow.\r\nTry different orientation.','',1,121),(152,'Access Assignment','Create a Student table.\r\n\r\nTasks\r\n1.	Students who belong to EKM city only can be added to the table.\r\n2.	Marks of each subject should be less that total marks.\r\n3.	Perform field, record and form validation based on the created table','',1,122);
