INSERT INTO `courses_testquestion` VALUES (48,'What is the function of  Ctrl + B in MS-Word?','It adds a line break to the document','It makes the selected text bold','It applies Italic formatting the selected text','It makes the selected text to bright','It makes the selected text bold',1,1),(49,'Which is not a font style ?','Bold','Superscript','Italic','Regular','Superscript',1,1),(50,'Word is a________________','Presentation programme','Word Processing programme','Spreadsheet programme','None of these','Word Processing programme',1,1),(51,'Ctrl + U','Undelete the previously deleted text','Underline the selected text','Underline the document name','Undo the last changes','Underline the selected text',1,1),(52,'In MS Word shortcut for paste is:','CTRL+C','CTRL+V','CTRL+X','None of these','CTRL+V',1,1),(53,'What is the shortcut key for \"Decrease Font Size\"\" the selected text?\"','ctrl + shift + >','ctrl + shift + <','ctrl + -','shift + +','ctrl + shift + <',1,1),(54,'what is the shortcut key for \"Finding a text in MS Word\"\"?\"','ctrl + F','ctrl + H','ctrl + Y','ctrl + Z','ctrl + F',1,1),(55,'Ctrl + Y is the shortcut key for ______?','Undo','Replace','Redo','Copy','Redo',1,1),(56,'Which key is used to navigate in MS Word without a mouse?','Ctrl','Shift','Esc','Alt','Alt',1,1),(57,'Which shortcut key is used to get the \'Font\' dialogue box?','Ctrl + Shift + F','Alt + Ctrl + H','Ctrl + Shift + R','Alt + Shift + F','Ctrl + Shift + F',1,1),(58,'Usually in a rows, line spacing is _________________________','1.5','2.0','0.5','1.0','1.0',1,2),(59,'What will be the use of Ctrl + E ?','Align center','Align Justify','Align left','Align right','Align Center',1,2),(60,'What is the shortcut key to select the entire text in a document?','Ctrl + A','Ctrl + B','Shift + A','Alt + A','Ctrl + A',1,2),(61,'Drop cap comes under _________ ribbon tab','Home','Insert','File','Layout','Insert',1,2),(62,'Which keys are used to select the text letter by letter?','Shift + Ctrl + Right a