ount in the document?','Status Bar','Zoom Control','Title Bar','QAT','Status Bar',1,3),(76,'The minimum number of rows and columns a word table can have is','Zero','2 rows and 1 column','1 rows and 1 column','2 row and 2 column','1 rows and 1 column',1,4),(77,'Which of the following formatting options is not available on the Tables and Borders toolbar?','border color','aligning text at the center of a cell','applying table formats automatically','all are formatting options on the Tables and Borders toolbar','all are formatting options on the Tables and Borders toolbar',1,4),(78,'Which command is used if you need a banded header row in a table?','Banded row','Banded columns','Header row','First column','Header row',1,4),(79,'When the cursor is in the last row last column which key will help to insert another row','Tab key','Esc key','Space Bar key','Enter key','Tab key',1,4),(80,'Individual boxes in a table are referred to as:','Cells','Boxes','Rows','Columns','Cells',1,4),(81,'Which are the contextual ribbon tabs that will get open when you insert a table?','Page layout & Formulas','Design & Layout','Design & Review','','Design & Layout',1,4),(82,'Which command is used to change the text direction in a table?','Alignment','Autofit','Sort','Text Direction','Text Direction',1,4),(83,'Combining two or more cells to make one is called:','combining','joining','merging','creating','merging',1,4),(84,'Distribute column command is used for ___________?','to distribute the height of the selected  rows equally','to distribute the width of the selected columns equally','to distribute the entire text equally','to distribute the rows & columns equally','to distribute the width of the selected columns equally',1,4),(85,'How many number of alignment positions are there in the design contextual tab in table?','12','3','6','9','9',1,4),(86,'We can remove / hide border of a shape by selecting ______','No Line','No Outline','White Line','No Border','No Outline',1,91),(87,'We can change the thickness of the border of a shape from ___','Format -> Wrap text','Format -> Shape Effects','Format -> Fill shape','Format -> Shape outline','Format -> Shape outline',1,91),(88,'Color and pattern used to fill a closed shape is called','Shape','WordArt','Shape Fill','Fill Back','Shape Fill',1,91),(89,'Which command is used to change the shape of the picture inserted?','Picture Effects','Picture Styles','Picture border','Picture layout','Picture Styles',1,91),(90,'Which command will restore an image to its original state?','Recolor image','Replace image','Reset picture','Redo','Reset picture',1,91),(91,'In which command group is insert object tool lies?','Text','Illustrations','Add-ins','Header & Footer','Text',1,91),(92,'What you should do to convert a 2D image to a 3D image?','Change theartistic effects','Crop the picture','Remove the background','Do the correction','Remove the background',1,91),(93,'Which contextual ribbon tab is used to edit the datas in the inserted chart?','Layout','Format','Design','Insert','Design',1,91),(94,'To insert page break press ________','Shift + Ctrl + Enter','Alt + Enter','Ctrl + Enter','Shift + Enter','Ctrl + Enter',1,92),(95,'Which group in \'Insert\' tab helps you to add a signature line in your document?','Header & Footer','Text','Comments','Pages','Text',1,92),(96,'Without using the \'Insert\' menu, which tab helps you to insert a comment in your document?','Home','Review','Layout','View','Review',1,92),(97,'What enables you to move directly to specific location in a document?','Subdocuments','Cross-references','Bookmarks','Outlines','Bookmarks',1,92),(98,'What are inserted as cross-reference in Word?','Placeholders','Bookmarks','Objects','Word fields','Word fields',1,92),(99,'Changing the appearance of a document is called','Proofing','Editing','Formatting','All of above','Formatting',1,92),(100,'Which of the following groups would be most likely to contain a mathematical symbol such as a degree sign, greater than or equal to, or a Greek letter?','Tables','Illustration','Comments','Symbols','Symbols',1,92),(101,'To get to the ‘Symbol’ dialog box, click on the _______ menu and choose ‘Symbol’.','Insert','Format','Tools','Table','Insert',1,92),(102,'Which tab take you to page background?','Home','Insert','Design','Layout','Design',1,92),(103,'What is gutter margin?','Margin that is added to the left margin when printing','Margin that is added to right margin when printing','Margin that is added to the binding side of page when printing','Margin that is added to the outside of a page when printing','Margin that is added to the binding side of page when printing',1,93),(104,'Portrait and Landscape are ________','Page Orientation','Paper Size','Page Layout','All of these','Page Orientation',1,93),(105,'The direction of a rectangular page for viewing and printing is called ________','Orientation','Print Layout','Preview','Direction','Orientation',1,93),(106,'Which of the following command is used if you want the words to fit in the empty space & then continue the rest from there?','Line Numbers','Breaks','Hyphenation','Margins','Hyphenation',1,93),(107,'Which tab helps you to add \'Watermark\'?','Insert','Layout','References','Design','Design',1,93),(108,'Documents can be printed to','a CD','a file on the disk','a printer','b and c','b and c',1,93),(109,'The default paper  orientation is','A4','Landscape','Portrait','A3','Portrait',1,93),(110,'Which of the following options best describes the function of the shortcut key combination: Ctrl+P ?','Pressing Ctrl + P will print your document.','Pressing Ctrl+P will paste the contents of your document.','Pressing Ctrl+P will launch the Print area of the Backstage view.','Pressing Ctrl+P will open the Page Layout dialogue box.','Pressing Ctrl+P will launch the Print area of the Backstage view.',1,93),(111,'How many margins are there on a page?','Two(header and footer)','Four(top, bottom, right and left)','Two (landscape and portrait)','Four(cen